import React from "react"

const Frutas = () => {
    const frutas=["pera","mango","orange"]

    return (
        <React.Fragment>
              <ul>
                { 
                    frutas.map((fruta,index)=> (
                        <li key={fruta}>
                            {index + 1} -{fruta}
                        </li>
                
            
                ))}
            </ul>

        </React.Fragment>
    )
}

export default Frutas
